class MeasurementUnit {
  int? id;
  String? code;
  String? name;

  MeasurementUnit({this.id, this.code, this.name});

  factory MeasurementUnit.(
      Map<String, dynamic> json) {
    return MeasurementUnit(
      id: json['id'] as int?,
      code: json['code'] as String?,
      name: json['name'] as String?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'id': id,
      'code': code,
      'name': name,
    };
  }
}
